import React from 'react'
import { useLocation } from 'react-router-dom';

const CompanyItemDetails = () => {


  const location = useLocation()
  const company = location.state.company

  console.log(company)
  return (
    <div>
      <table>
        <th>Company Name</th>
      </table>
    </div>
  )
}

export default CompanyItemDetails
